-- ----------------------------
--  Function structure for `getCertType2`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCertType2`;
delimiter ;;
CREATE DEFINER=`coffee`@`%` FUNCTION `getCertType2`(pCodeNo VARCHAR(32),pItemNo VARCHAR(32)) RETURNS varchar(250) CHARSET utf8
BEGIN
	DECLARE pBankno  VARCHAR(250);
	
	SET pBankno='';
	SELECT bankno INTO pBankno
	FROM Code_Library
	WHERE CodeNo=pCodeNo AND ItemNo=pItemNo;
	IF pBankno IS NULL THEN
            RETURN pItemNo;
	ELSE
            RETURN pBankno;
	END IF;
	
END
 ;;
delimiter ;

