CREATE DEFINER=`coffee`@`%` FUNCTION `getitemname`(pCodeNo VARCHAR(32),pItemNo VARCHAR(32)) RETURNS varchar(250) CHARSET utf8
BEGIN
	DECLARE pItemName  VARCHAR(250);
	
	SET pItemName='';
	SELECT ItemName INTO pItemName
	FROM Code_Library
	WHERE CodeNo=pCodeNo AND ItemNo=pItemNo;
	IF pItemName IS NULL THEN
            RETURN pItemNo;
	ELSE
            RETURN pItemName;
	END IF;
	
END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getorgname`
-- ----------------------------
DROP FUNCTION IF EXISTS `getorgname`;
delimiter ;;
CREATE DEFINER=`coffee`@`%` FUNCTION `getorgname`(pOrgID VARCHAR(32)) RETURNS varchar(80) CHARSET utf8
BEGIN
        DECLARE  pOrgName VARCHAR(80) ;
        
	SELECT OrgName INTO pOrgName
	FROM Org_info
	WHERE Orgid = pOrgID;
	 
	RETURN pOrgName;
    END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getusername`
-- ----------------------------
DROP FUNCTION IF EXISTS `getusername`;
delimiter ;;
CREATE DEFINER=`coffee`@`%` FUNCTION `getusername`(pUserID VARCHAR(32)) RETURNS varchar(32) CHARSET utf8
BEGIN
	DECLARE pUserName VARCHAR(32);
	SELECT UserName INTO pUserName FROM User_Info WHERE userid = pUserID;
	RETURN pUserName;
    END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `nvl`
-- ----------------------------
DROP FUNCTION IF EXISTS `nvl`;
delimiter ;;
CREATE DEFINER=`coffee`@`%` FUNCTION `nvl`(PString VARCHAR(1000), PToString VARCHAR(1000)) RETURNS varchar(1000) CHARSET utf8
BEGIN
      DECLARE pReturn VARCHAR(1000);
      IF (PString IS NULL) THEN
  SET pReturn = PToString;
      ELSE
  SET pReturn = PString;
      END IF;
      RETURN pReturn;
    END
 ;;
delimiter ;

